import React from "react";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import Home from "./pages/Home";


/* BrowserRouter englobe toute l'app */
const App = () => {

  return (
      <BrowserRouter>
      <Routes>
          <Route path="/" element={<Home></Home>} />
      </Routes>
      </BrowserRouter>
  )
} 

export default App;
